bool foundSw = false;

for (const std::pair<
         std::string,
         std::vector<std::pair<
             std::string, std::vector<std::string>>>>&
         obj : subtree)
{
    const sdbusplus::message::object_path path(
        obj.first);
    if (path.filename() != swId)
    {
        continue;
    }

    if (obj.second.size() < 1)
