sdbusplus::asio::setProperty( # <- no explicit template parameter
        *crow::connections::systemBus, service, path,
        "xyz.openbmc_project.Software.Settings", "WriteProtected",
        writeProtected,
        [asyncResp](const boost::system::error_code ec) {
            if (ec)
            {
                BMCWEB_LOG_ERROR << "setWriteProtected D-Bus responses error: "
                                 << ec;
                messages::internalError(asyncResp->res);
                return;
            }
            messages::success(asyncResp->res);
        });

If you want to be explicit then because of perfect forwarding you either need to make explicit copy you you did in this workaround or pass a type that should be deduced by perfect forwarding in this case it would be bool& or bool&& if std::move is used.

